import React, { Component } from 'react';
import axios from 'axios';

export default class CreateProfessor extends Component {
  constructor(props) {
    super(props);

    this.onChangeUsername = this.onChangeUsername.bind(this);
    this.onChangePassword = this.onChangePassword.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      username: '',
      password:''
    }

  }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value
    })
  }
  onChangePassword(e) {
    this.setState({
      password: e.target.value
    })
  }


  onSubmit(e) {
    e.preventDefault();

    const professor = {
      username: this.state.username,
      password:this.state.password
    }

    console.log(professor);

    axios.post('http://localhost:5000/professor/add', professor)
      .then(res => console.log(res.data));

    this.setState({
      username: '',
      password:''
    })
  }

  render() {
    return (
      <div>
        <h3>Create New Professor</h3>
        <form onSubmit={this.onSubmit}>
          <div className="form-group"> 
            <label>Username: </label>
            <input  type="text"
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}
                />
                <label>password: </label>
                <input  type="password"
                    required
                    className="form-control"
                    value={this.state.password}
                    onChange={this.onChangePassword}
                    />
          </div>
          <div className="form-group">
            <input type="submit" value="Create Professor" className="btn btn-primary" />
          </div>
        </form>
      </div>
    )
  }
}
